import React from 'react';
import IG from '../img/IG.png';
import Mail from '../img/Mail.png';
import '../App.css';


class Footer extends React.Component {
    render() {
        return (
            <footer style={{backgroundColor:'black'}}>
            <div className="container" >
                <div className="row">
                    <div className="col-lg-8 col-md-10 mx-auto">
                        <ul className="list-inline text-center">
                            <li className="list-inline-item">
                                <a href="#!">
                                  <button class=" big-button1"><img src={IG} alt="IG" Width="20" Height="20"/></button>
                                </a>
                            </li>
                            <li class="list-inline-item">
                                <a href="#!">
                                  <button class="btn1 big-button1"><img src={Mail} alt="Mail" Width="20" Height="20"/></button>
                                </a>
                            </li>
                        </ul>
                        <p class="copyright text-muted"><b style="">Copyright &copy; Blog di A.C. 2021</b></p>
                    </div>
                </div>
            </div>
          </footer>
        );
    }
}

export default Footer;
